Early into the Garage AM recording, around 2 or 2.5 seconds, I hear the female voice saying something about &quot;the box.&quot;  Closer to about 7 seconds, I hear the male voice reply with the word &quot;box,&quot; but -- gosh -- I wish he&#39;d enunciate more clearly!

That said, this is one of the most fun recordings I&#39;ve heard in awhile.  They sound like nice people from the 1950s or so.  Nice rounded tones to their voices.  Happy people... very nice!

Thanks for posting these!

Cheerfully,
Fiona



